<template>
    <div class="login">
        <!-- 正常布局 -->
        <el-container>
            <el-header style="height: 40vh; min-height: 240px; color: white">
                <div class="animated fadeInDown" style="font-size: 36px; padding-top: 15vh; padding-left: 40px">
                    <img  src="data:image/png;base64," style="vertical-align: middle;">
                    <span style="margin: 0 10px; vertical-align: middle;">欢迎光临在线考试系统</span>
                </div>
            </el-header>
            <el-main style="height: 60vh; min-height: 360px; background: white">
                <div style="font-size: 36px; padding-top: 10vh; padding-left: 10vw">
                    <i @click="ui.s1=!ui.s1" :class="{'pulse':ui.s1}" style="color: #d4e8f6;" class="animated fa fa-balance-scale fa-5x"></i>
                </div>
            </el-main>
        </el-container>
        <!-- 绝对布局 -->
        <div style="top: 0; position: absolute; right: 0;">
            <div style="height: 20vh; min-height: 120px;"></div>
            <el-form :model="input" ref="input" label-width="70px" label-position="right" :rules="rules">
                <div class="animated fadeIn user-icon">
                    <i v-if="!user.name" style="vertical-align: middle" class=" fa fa-user-circle fa-4x animated fadeInLeft"></i>
                    <i v-if="user.name" style="vertical-align: middle" class=" fa fa-user-circle fa-4x animated fadeInRight"></i>
                    <div v-if="user.name" class="animated fadeInRight" style="display: inline-block; padding: 10px 0 0 5px; vertical-align: middle; font-size: 25px">
                        {{user.name}}
                        <el-tag v-if="false" style="vertical-align: middle;"> {{user.status}}</el-tag>
                    </div>
                </div>

                <el-form-item label="身份" prop="fydm">
                    <el-select v-model="input.yhsf" placeholder="请选择身份" style="width: 100%">
                        <el-option label="学生" value="student">
                        </el-option>
                        <el-option label="老师" value="teacher">
                        </el-option>
                        <el-option label="管理员" value="admin">
                        </el-option>
                    </el-select>
                </el-form-item>
                <el-form-item label="用户名" prop="username">
                    <el-input type="text" v-model="input.username" placeholder="请输入用户名">
                        <i slot="suffix" class="el-input__icon el-icon-edit-outline"></i>
                    </el-input>
                </el-form-item>
                <el-form-item label="密码" prop="password">
                    <el-input type="password" v-model="input.password" placeholder="请输入密码">
                        <i slot="suffix" class="el-input__icon el-icon-view"></i>
                    </el-input>
                </el-form-item>
                <el-form-item label="记住密码">
                    <el-switch v-model="input.rememberme"></el-switch>
                </el-form-item>
                <el-form-item>
                    <el-button type="primary" @click="validateAndLogin('input')">登录</el-button>
                    <i v-if="ui.isLogining" class="el-icon-loading"></i>
                </el-form-item>
            </el-form>
        </div>
    </div>
</template>

<script>
    import * as axios from 'axios'
    import api from '../config/api2'
    import strutil from '../utils/strutil'
    import cookieutil from '../utils/cookieutil'
    import lodash from 'lodash'

    export default {
        name: 'Login',
        data: function () {
            return {
                ui: {
                    isLogining: false,
                    s1: false, // 天平
                },
                input: {
                    yhsf: null,
                    username: null,
                    password: null,
                    rememberme: false,
                },
                user: {
                    name: null,
                    status: null,
                },
                lib: {
                    courts: null,
                },
                rules: {
                    yhsf: [{required: true, message: '请选择身份', trigger: 'change'}],
                    username: [{required: true, message: '请输入用户名', trigger: 'blur'}],
                    password: [{required: true, message: '请输入密码', trigger: 'blur'}]
                }
            }
        },
        mounted: function () {
            this.initCourts();
            this.setInputFromCookie();
        },
        watch: {
            'input.username': function (val) {
                if (val) this.searchUser();
            },
            'input.rememberme': function (val) {
                if (val == false) cookieutil.remove("password")
                cookieutil.set("rememberme", val);
            }
        },

        methods: {
            // 根据用户名查找用户
            searchUser: lodash.debounce(function () {
                if (this.input.yhsf && this.input.username) {
                    let data = {yhsf: this.input.yhsf, username: this.input.username};
                    axios.get(api.User, {'params': data}).then(response => {
                        this.user.name = response.data.yhmc;
                        this.user.status = response.data.yhsf;
                    });
                } else {
                    this.user.name = null;
                    this.user.status = null;
                }
            }, 1000),
            // 验证并登陆
            validateAndLogin: function (form) {
                this.$refs[form].validate(valid => {
                    if (valid) this.doLogin();
                });
            },
            doLogin: function () {
                let input = {
                    yhsf: this.input.yhsf,
                    username: this.input.username,
                    password: this.input.password,
                };
                this.ui.isLogining = true;
                axios.post(api.TryLogin, input).then(response => {
                    this.ui.isLogining = false;
                    let data = response.data;
                    if (data.success) {
                        this.setCookieFromInput();
                        this.$emit('onLogin', data);
                    } else {
                        this.$message({message: data.msg, type: 'warning'});
                    }
                }).catch(error => {
                    this.ui.isLogining = false;
                    this.notifyServerError(error)
                });
            },
            // 初始化法院代码和默认法院
            initCourts: function () {
                axios.get(api.Courts).then(response => {
                    this.lib.courts = response.data;
                    if (this.lib.courts && !this.input.yhsf) {
                        this.input.yhsf = this.lib.courts[0].yhsf;
                    }
                }).catch(error => this.notifyServerError(error));
            },
            // 提示服务器错误
            notifyServerError: function (error, type) {
                let prefix = error.response ? "服务错误：" : "错误。";
                this.$message({
                    message: prefix + error.message,
                    type: type || 'error',
                });
            },
            // 从cookie中初始化form信息
            setInputFromCookie: function () {
                this.input.yhsf = cookieutil.get("yhsf");
                this.input.username = cookieutil.get("username");
                this.input.rememberme = cookieutil.get("rememberme") == "true";
                if (this.input.rememberme) {
                    this.input.password = cookieutil.get("password");
                } else {
                    cookieutil.set("password", null);
                }
            },
            setCookieFromInput: function () {
                cookieutil.set("username", this.input.username);
                cookieutil.set("yhsf", this.input.yhsf);
                cookieutil.set("rememberme", this.input.rememberme);
                if (this.input.rememberme) {
                    cookieutil.set("password", this.input.password);
                } else cookieutil.remove("password")
            },
        }
    }
</script>

<style scoped>
    .login {
        /* TODO 要改为本地加载 */
        background-image: url("data:image/jpg;base64,");
        min-width: 960px;
        min-height: 600px;
    }

    .user-icon {
        /*padding-top: -20px;*/
        color: #409EFF;
        text-align: center;
        margin-bottom: 30px;
    }

    .user-icon > i {
        border-radius: 50px;
    }

    .user-icon > i:hover {
        box-shadow: 0 0 3px #409EFF;
    }

    .el-form {
        margin-right: 10vw;
        width: 400px;
        border: 1px solid #dedede;
        padding: 30px 50px 50px 50px;
        background: white;
        size: 16px;
        z-index: 100;
        position: relative;
        box-shadow: 1px 1px 10px #b2b2b2;
        border-radius: 5px;
        min-height: 50vh;
    }
</style>
